import React from 'react';
import { NavLink } from 'react-router-dom';

export const Wrapper = ({ children }) => (
	<section className="w-80 center mt4 flex justify-between">{children}</section>
);

export const Card = ({ back }) => (
	<section className="ba w-32 h7">
		<div className="flex absolute h-inherit w-inherit hover-gold pt4  futura ttu white fw7 f1">
			Astronauts
		</div>
		<img src={back} alt="prj" className="obj-cover" />
	</section>
);
